webpackJsonp([0x9cee53d7d9d8],{1007:function(a,e){a.exports={data:{markdownRemark:{html:'<ul>\n<li><a href="https://danmaq.com/filez/em_trial.pdf">全 180 ページ中 69 ページまで公開！体験版 PDF を読む</a> ([filesize]<a href="https://danmaq.com/filez/em_trial.pdf%5B/filesize%5D">https://danmaq.com/filez/em_trial.pdf[/filesize]</a>)</li>\n</ul>\n<blockquote>\n<p>不思議な能力が使える女の子エナとその弟、そして幼馴染は村の悪ガキ三人組として有名。\nしかしもっと悪いやつ、領主に幼馴染が攫われてしまい、領主の館でも彼女らが大暴れ！\nただの勧善懲悪では終わらない、新感覚のオリジナル ファンタジー物語！</p>\n</blockquote>\n<p>全180ページのちょっとダークな本格ファンタジー ライトノベルです。カバーイラスト、および挿絵は<a href="http://dungeonmania.web.fc2.com/">桜姫つかさ</a>さんに描いていただきました！(ちなみに一箇所だけ私が描いたイラストが混じっていますので、よければ探してみてください) <img src="https://danmaq.com/wp-content/uploads/2012/11/em_POP-300x300.png" alt="まだまだお子様な、悪ガキ三人衆が大暴れ！剣と魔法の、本格ファンタジー小説！"></p>\n<ul>\n<li><a href="https://danmaq.com/filez/em_trial.pdf">全 180 ページ中 69 ページまで公開！体験版 PDF を読む</a> ([filesize]<a href="https://danmaq.com/filez/em_trial.pdf%5B/filesize%5D">https://danmaq.com/filez/em_trial.pdf[/filesize]</a>)</li>\n</ul>',frontmatter:{cover:{childImageSharp:{responsiveSizes:{src:"/danmaq.gatsby/static/evil_magic-b13c46b28419bca7d4698566f4d05fe2-381d6.jpg",srcSet:"/danmaq.gatsby/static/evil_magic-b13c46b28419bca7d4698566f4d05fe2-62f05.jpg 200w,\n/danmaq.gatsby/static/evil_magic-b13c46b28419bca7d4698566f4d05fe2-dc2b4.jpg 400w,\n/danmaq.gatsby/static/evil_magic-b13c46b28419bca7d4698566f4d05fe2-381d6.jpg 800w,\n/danmaq.gatsby/static/evil_magic-b13c46b28419bca7d4698566f4d05fe2-4d580.jpg 853w",sizes:"(max-width: 800px) 100vw, 800px"}}},date:"2013-12-29T16:00:03+09:00",strDate:"2013/12/29",redirect:null,title:"EVIL MAGIC ～ 邪の魔術",youtube:null},fields:{langKey:"ja",slug:"/ja/blog/2013/12/29-evil-magic/"}},site:{siteMetadata:{langKeyDefault:"ja",langs:["ja","en"]}}},pathContext:{path:"/ja/blog/2013/12/29-evil-magic/",langKey:"ja"}}}});
